  false,\n\t\"url\": null,\n\t\"notes\": \"Automatic Identification Systems (AIS)
  are a navigation safety device that transmits and monitors the location and characteristics
  of many vessels in U.S. and international waters in real-time. This dataset represents
  the density of fishing vessel traffic in 2013 for the contiguous United States offshore
  waters from fishing vessels with AIS transponders in 100 meter grid cells. The dataset
  is best interpreted using a high to low density scale and does not represent actual
  vessel counts.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
